import './card.css';
import { useState } from 'react';

export default function Card() {
  const [count, setCount] = useState(0);

    return (
      <div>
          <p>Вы нажали {count} раз</p>
          <button onClick={() => setCount(count + 1)}>
            Нажми на меня
          </button>
      </div>
    )
  }
